transform(FinalState, Plan) :- initial_state(State1), transform(State1, FinalState, [State1], Plan).
transform(State1, FinalState, _, []) :- state_subset(FinalState, State1).
transform(State1, State2, Visited, [Action|Actions]) :- choose_action(Action, State1, State2), update(Action, State1, State), not_member(State, Visited), transform(State, State2, [State|Visited], Actions).
choose_action(Action, State1, State2) :- suggest(Action, State1, State2), legal_action(Action, State1).
choose_action(Action, State1, _) :- legal_action(Action, State1).
suggest(walk(X), [_, _, _, _, _, on(OnI), _], [_, _, _, _, _, on(OnF), _]) :- not_member(X, OnI), member(X, OnF).
suggest(switchon(X), _, [_, _, _, _, _, on(On), _]) :- member(X, On).
suggest(put(X, Y), [_, _, _, _, _, _, _], [_, _, _, on_top_of(Oto), _, _, _]) :- member([X, Y], Oto).
suggest(walk(X), _, [close(Close), _, sat_on(Sat), _, _, _, _]) :- member(X, Sat), not_member(X, Close).
suggest(grab(X), [close(CloseI), _, _, _, _, _, _], [close(CloseF), _, sat_on(Sat), _, _, _, _]) :- not_member(Y, CloseI), member(Y, CloseF), member(X, Sat), -list_empty(CloseF).
suggest(walk(X), [_, holds(Held), _, _, _, _, _], [close(Close), _, sat_on(Sat), _, _, _, _]) :- member(X, Close), sittable(Y), X\=Y, member(Y, Sat), member(Y, Held).
suggest(put(X, Y), [close(CloseI), holds(Held), _, on_top_of(Oto), _, _, _], [close(CloseF), _, sat_on(Sat), _, _, _, _]) :- type(Y, floor), member(X, Sat), member(X, Held), member(Z, CloseI), member(Z, CloseF), ontopof_inherited(Y, Z, Oto).
suggest(walk(X), _, [_, _, _, on_top_of(Oto), _, _, _]) :- member([X, _], Oto).
suggest(walk(Y), [_, holds(Held), _, _, _, _, _], [_, _, _, on_top_of(Oto), _, _, _]) :- member([X, Y], Oto), member(X, Held).
suggest(grab(X), [close(Close), _, _, _, _, _, _], [_, _, _, on_top_of(Oto), _, _, _]) :- member([X, _], Oto), member(X, Close).
suggest(grab(X), _, [_, holds(Held), _, _, _, _, _]) :- member(X, Held).
suggest(lie(X), _, [_, _, _, _, _, _, laid_on(Lie)]) :- member(X, Lie).
suggest(standup, [_, _, sat_on([_]), _, _, _, _], _).
suggest(standup, [_, _, _, _, _, _, laid_on([_])], _).
suggest(walk(X), _, [close(Close), holds(Held), _, _, _, _, _]) :- member(X, Held), not_member(X, Close).
suggest(walk(X), _, [close(Close), _, _, _, _, _, laid_on(Laid)]) :- member(X, Laid), not_member(X, Close).
suggest(sit(X), _, [_, _, sat_on(Sat), _, _, _, _]) :- member(X, Sat).
suggest(walk(Room), State1, State2) :- item_of_interest(State1, State2, Item), state_inside(State1, Item, Room).
suggest(walk(X), _, [close(Close), _, _, _, _, _, _]) :- member(X, Close).
state_inside([_, _, _, _, inside(Inside), _, _], Item, Room) :- member([Item, Room], Inside).
item_of_interest([_, holds(HeldI), _, _, _, _, _], [_, holds(HeldF), _, _, _, _, _], Item) :- member(Item, HeldF), not_member(Item, HeldI).
item_of_interest([_, _, sat_on(SatI), _, _, _, _], [_, _, sat_on(SatF), _, _, _, _], Item) :- member(Item, SatF), not_member(Item, SatI).
item_of_interest([_, _, _, on_top_of(OtoI), _, _, _], [_, _, _, on_top_of(OtoF), _, _, _], Item) :- member([Item, _], OtoF), not_member([Item, _], OtoI).
item_of_interest([_, holds(HeldI), _, on_top_of(OtoI), _, _, _], [_, _, _, on_top_of(OtoF), _, _, _], Item) :- member([HeldItem, Item], OtoF), not_member(HeldItem, HeldI), not_member([HeldItem, Item], OtoI).
item_of_interest([_, _, _, _, _, on(OnI), _], [_, _, _, _, _, on(OnF), _], Item) :- member(Item, OnF), not_member(Item, OnI).
item_of_interest([_, _, _, _, _, _, laid_on(LaidI)], [_, _, _, _, _, _, laid_on(LaidF)], Item) :- member(Item, LaidF), not_member(Item, LaidI).
item_of_interest([close(CloseI), _, _, _, _, _, _], [close(CloseF), _, _, _, _, _, _], Item) :- member(Item, CloseF), not_member(Item, CloseI).
legal_action(walk(X), [_, _, sat_on([]), _, inside(Inside), _, _]) :- rooms(X), not_member([character1, X], Inside).
legal_action(walk(X), [close(Close), _, sat_on([]), _, inside(Inside), _, _]) :- type(X, Y), -rooms(X), Y\=character, member([X, Room], Inside), member([character1, Room], Inside), not_member(X, Close).
legal_action(grab(X), [close(Close), holds(Held), _, _, inside(Inside), _, _]) :- type(X, Y), Y\=character, member(X, Close), not_member(X, Held).
legal_action(sit(X), [close(Close), holds(Held), sat_on([]), _, inside(Inside), _, _]) :- sittable(X), member(X, Close), not_member(X, Held).
legal_action(lie(X), [close(Close), holds(Held), _, _, inside(Inside), _, laid_on([])]) :- lieable(X), member(X, Close), not_member(X, Held).
legal_action(standup, [_, _, sat_on([_]), _, _, _, _]).
legal_action(standup, [_, _, _, _, _, _, laid_on([_])]).
legal_action(put(X, Y), [close(Close), holds(Held), _, on_top_of(Oto), inside(Inside), _, _]) :- member(Y, Close), member(X, Held), not_member([X, Y], Oto).
legal_action(put(X, Y), [close(Close), holds(Held), _, on_top_of(Oto), inside(Inside), _, _]) :- type(Y, floor), ontopof_inherited(Y, Z, Oto), member(Z, Close), member(X, Held), not_member([X, Y], Oto).
legal_action(switchon(X), [close(Close), _, _, _, inside(Inside), on(On), _]) :- member(X, Close), not_member(X, On), has_switch(X).
update(walk(X), [close(Close), holds(Held), sat_on(Sat), on_top_of(Oto), inside(In), on(On), laid_on(Laid)], [close(Closen), holds(Held), sat_on(Sat), on_top_of(Oto), inside(Inf), on(On), laid_on(Laid)]) :- update_walking(X, [Close, Held], [], Closen), update_room(X, In, [], Inf).
update(grab(X), [close(Close), holds(Held), sat_on(Sat), on_top_of(Oto), inside(In), on(On), laid_on(Laid)], [close(Close), holds([X|Held]), sat_on(Sat), on_top_of(Oto), inside(In), on(On), laid_on(Laid)]).
update(sit(X), [close(Close), holds(Held), sat_on(Sat), on_top_of(Oto), inside(In), on(On), laid_on(Laid)], [close(Close), holds(Held), sat_on([X|Sat]), on_top_of(Oto), inside(In), on(On), laid_on(Laid)]).
update(lie(X), [close(Close), holds(Held), sat_on(Sat), on_top_of(Oto), inside(In), on(On), laid_on(Laid)], [close(Close), holds(Held), sat_on(Sat), on_top_of(Oto), inside(In), on(On), laid_on([X|Laid])]).
update(standup, [close(Close), holds(Held), sat_on([X]), on_top_of(Oto), inside(In), on(On), laid_on(Laid)], [close(Close), holds(Held), sat_on([]), on_top_of(Oto), inside(In), on(On), laid_on(Laid)]).
update(standup, [close(Close), holds(Held), sat_on(Sat), on_top_of(Oto), inside(In), on(On), laid_on([X])], [close(Close), holds(Held), sat_on(Sat), on_top_of(Oto), inside(In), on(On), laid_on([])]).
update(put(X, Y), [close(Close), holds(Held), sat_on(Sat), on_top_of(Oto), inside(In), on(On), laid_on(Laid)], [close(Close), holds(Heldn), sat_on(Sat), on_top_of([[X, Y]|Oto]), inside(In), on(On), laid_on(Laid)]) :- remove(X, Held, Heldn).
update(switchon(X), [close(Close), holds(Held), sat_on(Sat), on_top_of(Oto), inside(In), on(On), laid_on(Laid)], [close(Close), holds(Held), sat_on(Sat), on_top_of(Oto), inside(In), on([X|On]), laid_on(Laid)]).
update_walking(X, [[], _], State1, [X|State1]).
update_walking(X, [[Y|T], Held], State, State1) :- X\=Y, not_member(Y, Held), update_walking(X, [T, Held], State, State1).
update_walking(X, [[Y|T], Held], State, State1) :- update_walking(X, [T, Held], [Y|State], State1).
update_room(X, In, [], In) :- -rooms(X).
update_room(X, [], In1, [[character1, X]|In1]).
update_room(X, [[character1, Room]|T], State, State1) :- X\=Room, update_room(X, T, State, State1).
update_room(X, [[Item, Whatever]|T], State, State1) :- update_room(X, T, [[Item, Whatever]|State], State1).
